import { useState } from 'react';
import ListadoTemas from './ListadoTemas';

const ListadoTemasFunc = () => (
  <div>
    <h2>Listado de Temas</h2>
    <p>Aquí puedes ver todos los temas disponibles.</p>
    <ListadoTemas />
  </div>
);

const Dashboard = () => {
  const [mostrarListado, setMostrarListado] = useState(false);

  return (
    <div>
      <h2>Bienvenido al sistema</h2>
      <p>Has iniciado sesión correctamente.</p>
      <button onClick={() => setMostrarListado(true)}>Mostrar Temas</button>

      mostrarListado? <ListadoTemasFunc /> : null
    </div>
  );
};

export default Dashboard;
